import React from 'react';
import '../index.css';
import Header from './Header';
import Main from './Main';
import PopupWithForm from './PopupWithForm';
import ImagePopup from './ImagePopup';
import Footer from './Footer';

function App() {

  const [State, setState] = React.useState({ isEditAvatarPopupOpen: false, isEditProfilePopupOpen: false, isAddPlacePopupOpen: false });

  React.useEffect(() => {
    function handleEditAvatarClick(event) {
      setState({
        isOpen: true
      });
    }
        // Список действий внутри одного хука
    document.addEventListener('mousemove', handleEditAvatarClick);
    document.querySelector('.popup_edit-avatar').classList.add('popup_is-opened');

        // Возвращаем функцию, которая удаляет эффекты
    return () => {
      document.querySelector('.popup_edit-avatar').classList.remove('popup_is-opened');
      document.removeEventListener('mousemove', handleEditAvatarClick);
    };
  });

  return (

    <div className="page">
      <Header />
      <Main 
        onEditAvatar={() => document.querySelector('.popup_edit-avatar').classList.add('popup_is-opened')}
        onEditProfile={() => document.querySelector('.popup_edit-profile').classList.add('popup_is-opened')} 
        onAddPlace={() => document.querySelector('.popup_add-card').classList.add('popup_is-opened')}
      />
      <PopupWithForm class='edit-avatar' name='avatar-content' title='Обновить аватар' submitText='Сохранить' 
        closeAllPopups={() => {document.querySelectorAll('.popup').forEach((popup) => popup.classList.remove('popup_is-opened'))}}>
        <input type="url" id="avatar-field" className="popup__field popup__field_input_avatar" required placeholder="Ссылка на аватар" name="link" value=""/>
        <span className="avatar-field-error popup__field-error"></span>
      </PopupWithForm>
      <PopupWithForm class='edit-profile' name='profile-content' title='Редактировать профиль' submitText='Сохранить' 
        closeAllPopups={() => {document.querySelectorAll('.popup').forEach((popup) => popup.classList.remove('popup_is-opened'))}}>
        <input type="text" id="name-field" className="popup__field popup__field_input_name" minLength="2" maxLength="40" required placeholder="Ваше имя" name="name" value="Жак-Ив Кусто"/>
        <span className="name-field-error popup__field-error"></span>
        <input type="text" id="profession-field" className="popup__field popup__field_input_profession" minLength="2" maxLength="200" required placeholder="Ваша профессия" name="about" value="Исследователь океана"/>
        <span className="profession-field-error popup__field-error"></span>
      </PopupWithForm>
      <PopupWithForm class='add-card' name='card-content' title='Новое место' submitText='Создать' 
        closeAllPopups={() => {document.querySelectorAll('.popup').forEach((popup) => popup.classList.remove('popup_is-opened'))}}>
        <input type="text" id="card-field" className="popup__field popup__field_input_card" minLength="2" maxLength="30" required placeholder="Название" name="name" value=""/>
        <span className="card-field-error popup__field-error"></span>
        <input type="url" id="link-field" className="popup__field popup__field_input_link" required placeholder="Ссылка на картинку" name="link" value=""/>
        <span className="link-field-error popup__field-error"></span>
      </PopupWithForm>
      <PopupWithForm class='delete-card' name='delete-confirmation' title='Вы уверены?' submitText='Да' 
        closeAllPopups={() => {document.querySelectorAll('.popup').forEach((popup) => popup.classList.remove('popup_is-opened'))}} />
      <ImagePopup />
      <Footer />


    <template id="element-template">
    <div className="element">
      <button type="button" aria-label="Удалить" className="element__trash"></button>
      <img className="element__image" src="https://images.unsplash.com/photo-1502489352690-20d1494ac469?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=715&q=80" alt="фото"/>
      <div className="element__group">
        <h2 className="element__text"></h2>
        <div className="element__likes">
          <button type="button" aria-label="Нравится" className="element__like"></button>
          <div className="element__count">0</div>
        </div>
      </div>
    </div>
  </template>

  </div>
  );
}

export default App;
